 INSERT INTO srdb.assessment VALUES('DFO-QUE-HERR4RSP-1963-2004-PREFONTAINE', 'DFO-QUE', 'HERR4RSP', 'PREFONTAINE', '2008-05-30', '2012-06-07 11:35:23', '1963-2004', 'http://www.dfo-mpo.gc.ca/csas/csas/Publications/Pub_Index_e.htm', 'contact details ', 'This assessment is for the spring spawing stock of herring as the data on the fall spawning herring is insufficient. The data for maturity at age was taken from the purse-seine fishery landings from April-June (second quarter). The SPA bias was adjusted by a bootstrap analysis; the biomass and abundance numbers for 2003 and 2004 were calculated from the mean recruitment attributed to age 2 of year-classes 2001 and 2002.', '', 1, 1, 'SPA-ADAPT', 'no comments', '../spreadsheets/PREFONTAINE-HERR4RSP-2004-editedRP-QAQC.xls', '999') ; 
